
import math
import time
from collections import OrderedDict
import optuna

# This is a nonsense function. It is fast to compute.
def func_to_optimize(vec):
    sum = 0
    i = 0
    for val in vec:
        i += 1
        sugg = vec[val]
        if isinstance(sugg, str):
            # The suggestion might contain metadata.
            continue
        sum += math.pow(abs(float(i) - sugg), float(i)/3.0)
    return sum

def optuna_objective(trial):
    num_params = 5

    vec = {}
    for i in range(num_params):
        nm = "val_" + str(i)
        vec[nm] = trial.suggest_float(nm, -10, 10)
    return func_to_optimize(vec)

def profile_bones():
    study = optuna.create_study()

    num_trials = 1000

    obs_durations = []

    for i in range(num_trials):
        observe_start_time = time.time()
        study.optimize(optuna_objective, n_trials=1)
        obs_duration = time.time() - observe_start_time
        print("OBSERVATION TOOK TIME", obs_duration)
        obs_durations.append(obs_duration)
        if i % 100 == 0:
            print("OBSERVATION DURATIONS:", obs_durations)
            print("Best value: {} (params: {})\n".format(study.best_value, study.best_params))
    # In seconds
    print("OBSERVATION DURATIONS:", obs_durations)
    print("Best value: {} (params: {})\n".format(study.best_value, study.best_params))

profile_bones()

